function App() {
    const expenses = [
        { title: "Car Insurance", amount: 291.12, date: new Date(2021,4,5)},
        { title: "Car Insurance", amount: 291.12, date: new Date(2021,4,5)},
        { title: "Car Insurance", amount: 291.12, date: new Date(2021,4,5)},
        { title: "Car Insurance", amount: 291.12, date: new Date(2021,4,5)},
    ]
    return (
        <div>
            <h2>Let's get started!</h2>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>
        </div>
    );
}

export default App;
